import React from 'react';
import './App.css';
function App() {
    const [search, setSearch] = React.useState('');

    const onChange = (event) => {
        setSearch(event.target.value);
    };
    return (
        <div className='App'>
            <form>
                <input name='search' value={search} onChange={onChange} />
            </form>
        </div>
    );
}

export default App;
